#define DEFINE_ATOMIC_STORE(name, t1, t2)                              \
  static inline void name(wasm_rt_memory_t* mem, u64 addr, t2 value) { \
    MEMCHECK(mem, addr, t1);                                           \
    ATOMIC_ALIGNMENT_CHECK(addr, t1);                                  \
    t1 wrapped = (t1)value;                                            \
    atomic_store_##t1(&mem->data[addr], wrapped);                      \
  }

