#define DEFINE_ATOMIC_RMW(name, op, t1, t2)                          \
  static inline t2 name(wasm_rt_memory_t* mem, u64 addr, t2 value) { \
    MEMCHECK(mem, addr, t1);                                         \
    ATOMIC_ALIGNMENT_CHECK(addr, t1);                                \
    t1 wrapped = (t1)value;                                          \
    t1 ret = atomic_##op##_##t1(&mem->data[addr], wrapped);          \
    return (t2)ret;                                                  \
  }

